const Disney = {
    "data": {
        "title": "Which Disney character are you?",
        "results": [
            {
                "male": "Mr Incredible",
                "female": "Elastigirl",
                "value": 5
            },
            {
                "male": "Hercules",
                "female": "Pocahontas",
                "value": 4
            },
            {
                "male": "Tarzan",
                "female": "Elsa",
                "value": 3
            },
            {
                "male": "Sully",
                "female": "Moana", 
                "value": 2
            },
            {
                "male": "Russell",
                "female": "Ursula",
                "value": 1
            }
        ],
        "fillerQuestions": [
            "Do you like dogs?",
            "Would you live in the city?",
            "Would you live in Asia?",
            "Do you think it's funny when someone gets startled?",
            "Do you think you would look good if you were somewhat translucent?"
        ],
        "dataDrivenQuestions": [
            "Do you enjoy sports?",
            "Do you prefer walking to driving?",
            "Do you hate being in bed all day?",
            "Do you live an active lifestyle?",
            "Would you consider yourself physically fit?"
        ]
    }
  };

  export default Disney;
